    private Family newFamilyItem = new Family();
    private Adult newAdult = new Adult();
    private string errorMessage;

    private void AddNewFamily() {
        errorMessage = "";
        try
        {
            FamilyService.AddFamily(newFamilyItem);
            NavigationManager.NavigateTo("/Families");
        }
        catch (Exception e)
        {
            errorMessage = e.Message;
        }
    }

    private void AddNewAdult()
    {
        errorMessage = "";
        try
        {
            FamilyService.ValidatePerson(newAdult.FirstName, newAdult.LastName, newAdult.Sex, newAdult.Id);

            FileContext.AddAdult(newAdult);
            NavigationManager.NavigateTo("/Adults");
        }
        catch (Exception e)
        {
            errorMessage = e.Message;
        }
    }

    [CascadingParameter] protected Task<AuthenticationState> AuthStat { get; set;  }

    protected async override Task OnInitializedAsync()
    {
        base.OnInitialized();
        var user = (await AuthStat).User;
        if (!user.Identity.IsAuthenticated)
        {
            NavigationManager.NavigateTo($"/");
        }
    }
    

